import React, { Component } from 'react'
import {BrowserRouter,Route} from  "react-router-dom"
import About from './About'
import Home from './Home'

export default class App extends Component {
  render() {
    return (
      <BrowserRouter >
        <div>
          <h1>我是App组件</h1>
          <Home />
          <About />
        </div>
      </BrowserRouter>
    )
  }
}
